SET NOCOUNT ON 

USE master 
GO 

IF  EXISTS (SELECT * FROM sys.databases WHERE name = N'data_analysis_flights') DROP DATABASE data_analysis_flights
GO 

CREATE DATABASE data_analysis_flights
GO 

USE data_analysis_flights
GO 

CREATE TABLE [dbo].[airlines](
	[iata_code] [varchar](2) PRIMARY KEY,
	[airline] [varchar](28) NULL)
GO

CREATE TABLE [dbo].[airports](
	[iata_code] [varchar](3) PRIMARY KEY,
	[airport] [varchar](78) NULL,
	[city] [varchar](30) NULL,
	[state] [varchar](2) NULL,
	[country] [varchar](3) NULL,
	[latitude] [int] NULL,
	[longitude] [int] NULL)
GO 

CREATE TABLE [dbo].[flights](
	[flight_id] [int] IDENTITY(1,1) PRIMARY KEY,
	[flight_date] [date] NULL,
	[airline] [varchar](2) NULL,
	[flight_number] [bigint] NULL,
	[origin_airport] [varchar](3) NULL,
	[destination_airport] [varchar](3) NULL,
	[delay_in_minutes] [int] NULL,
	[cancelled] [int] NULL,
	[cancel_reason] [varchar](25) NULL)
GO 

USE [data_analysis_flights]
GO
